За минувшие сутки в России обновилось сразу 28 температурных рекордов, сообщил РИА Новости ведущий специалист центра погоды "Фобос" Евгений Тишковец.

"Всего по стране было зафиксировано 28 небывалых за всю метеоисторию 1 июля значений максимальной температуры", — сказал он.

По словам собеседника агентства, пять рекордов отмечены в региональных центрах:
Херсон — плюс 35,9 (предыдущий максимум — плюс 34,7 в 2017 году);
Псков — плюс 34,3 (плюс 30,7 в 2022-м);
Чита — плюс 34,1 (плюс 33,8 в 2022-м);
Санкт-Петербург — плюс 33,2 (плюс 31,9 в 2022-м);
Орел — плюс 31,5 (плюс 31,1 в 1964-м).

В Подмосковье, несмотря на аномальный зной, единственным местом, где зарегистрировали температурный рекорд, стала Коломна: плюс 32,2 по сравнению с плюс 30,8 градуса в 1999 году.
"В Москве на базовой метеостанции ВДНХ воздух разогрелся до плюс 30,2, в центре города, на Балчуге, до плюс 32,1 градуса", — добавил Тишковец.

Жаркая сухая погода установилась на значительной части территории России. В Москве в первые дни июля ожидается до 30-33 градусов, а к концу недели, по прогнозу синоптиков, на столицу обрушится непогода с сильными грозами, штормовым шквалом, градом и залповым ливнем.
